<template>
	<view class="empty-content" :class="{'hasMenu':hasMenu==1}" :style="cssBottom">
		<image class="empty-content-image" :src="pic" mode="aspectFit"></image>
		<p class="text">
			<span  v-if="my_type=='order'">暂时没有订单哦~</span>
			<span  v-else-if="my_type=='collection'">暂时没有收藏哦~</span>
			<span  v-else-if="my_type=='cart'">暂时没有购物车数据哦~</span>
			<span  v-else>暂时没有数据哦~</span>
		</p>
	</view>
</template>

<script>
	export default {
		props: {
			type: {
				type: String,
				default: 'default',
			},
			
			hasMenu:{
				type:String,
				default:'0'
			},
			isShop:{
				type:Boolean,
				default:false
			}
		},
		computed: {
			cssBottom(){
				if(this.isShop){
					// return ''
					// #ifdef H5
					return ''
					// #endif
					// #ifdef MP-WEIXIN
					return ''
					// #endif
				}else{
					
					// #ifdef H5
					return 'top:200px'
					// #endif
					// #ifdef MP-WEIXIN
					return 'top:300rpx'
					// #endif
				}
			}
		},
		data() {
			return {
				imgList: {
					default: 'data:image/png;base64,',order:'data:image/png;base64,',cart:'data:image/png;base64,',collection:'data:image/png;base64,'
				},
				pic:'',
				my_type:''
			}
		},
		mounted(){
			console.log('this.isShop---',this.isShop)
			this.my_type = this.type;
			if(this.my_type=='shop'||this.my_type=='notShop'){
				this.my_type = 'default'
			}
			this.pic=this.imgList[this.my_type];
		},
	}
</script>

